import React from 'react'
import StoryReel from './StoryReel';
import MessageSender from './MessageSender';
import Post from './Post'
import './Feed.css'

function Feed() {
    return (
        <div className='feed'>
            <StoryReel/>
            <MessageSender/>
            <Post
             
            profile='data:image/png;base64,'
            message='it works'
            timestamp='skll'
            image='data:image/png;base64,'
            
            />
             


        </div>
    )
}

export default Feed;
